import { Link } from "react-router-dom";
const eventsList = [
  { id: "event1", title: "This is Event 1!" },
  { id: "event2", title: "This is Event 2!" },
  { id: "event3", title: "This is Event 3!" },
  { id: "event4", title: "This is Event 4!" },
  { id: "event5", title: "This is Event 5!" },
];
export default function () {
  return (
    <>
      <ul>
        {eventsList.map((each) => {
          return (
            <li>
              <Link to={`${each.id}`}>{each.title}</Link>
            </li>
          );
        })}
      </ul>
    </>
  );
}
